import React, { useEffect, useState } from "react";
import axios from "axios";

export default function TeamCard(props) {
  const [imgUrl, setImgUrl] = useState();
  console.log(props.teams);

  useEffect(() => {
    const { featured_media } = props.teams;
    axios
      .get(`https://wordpress.nsattu.com/wp-json/wp/v2/media/${featured_media}`)
      .then((res) => {
        setImgUrl(res.data.guid.rendered);
      })
      .catch((err) => console.log(err));
  }, [props.teams]);

  return (
    <div className="flex flex-col items-center p-8 transition-colors duration-200 transform border cursor-pointer group hover:bg-blue-600 rounded-xl">
      <img
        className="object-cover w-32 h-32 rounded-full ring-4 ring-gray-300"
        src={imgUrl}
        alt=""
      />
      <h1 class="mt-4 text-2xl font-semibold text-gray-700 capitalize group-hover:text-white">
        arthur melo
      </h1>
    </div>
  );
}
